import React from 'react';
import { Link } from 'react-router-dom';

const LandingPage = () => {
    return (
        <div>
            {/* Navbar */}
            <header style={styles.navbar}>
                <h2 style={styles.logo}>CrickBidders</h2>
                <nav style={styles.navLinks}>
                    <Link to="/" style={styles.link}>Home</Link>
                    <Link to="/signup" style={styles.link}>Sign Up</Link>
                    <Link to="/login" style={styles.link}>Log In</Link>
                    <Link to="/about" style={styles.link}>About</Link>
                </nav>
            </header>

            {/* Main Content */}
            <main style={styles.mainContent}>
                <h1>Welcome to CrickBidders</h1>
                <p>Your ultimate platform for cricket auctions!</p>
                <div style={styles.buttonContainer}>
                    <Link to="/signup" style={styles.button}>Get Started</Link>
                    <Link to="/login" style={styles.button}>Log In</Link>
                </div>
            </main>

            {/* Footer */}
            <footer style={styles.footer}>
                <p>&copy; 2024 CrickBidders. All Rights Reserved.</p>
                <nav>
                    <Link to="/privacy" style={styles.footerLink}>Privacy Policy</Link> | 
                    <Link to="/terms" style={styles.footerLink}>Terms of Service</Link>
                </nav>
            </footer>
        </div>
    );
};
